import {ReactComponent as Logo} from 'assets/images/masipack-logo.svg'
import './styles.css'


const Login = () => {
    return (
        <div className="login-card">
            <Logo/>
            <h1>Login</h1>
            <form>
                <input />
                <input />
                <button>ENTRAR</button>
            </form>
        </div>
    )
}

export default Login;
